This section is non-normative. This specification assumes the presence of a type that allows the instance of a signaled error to carry information regarding the location of the error and any other relevant context. The following is a non-normative structure that may be referenced by this specification. structure Error { kind: ErrorKind, caused_by: Option<Error>, source_line: Option<integer>, source_column: Option<integer>, message: string,
} kind -- the error identifier. caused_by -- an optional inner value allowing error instances to be nested. source_line -- where possible the parser should identify the 1-based line number where the error occurred. source_column -- where possible the parser should identify the 1-based column number where the error occurred. message -- a string providing as much information as possible regarding this error instance including any labels associated with values in error. The above structure required a type ErrorKind, this is the enumeration of all the error identifiers from the section above. enumeration ErrorKind { ERR_UNSUPPORTED_DIALECT, ...
} From The Open Group man page for the open() function.

