The characters allowed in labeling relations, attributes, facts, atoms, and variables are taken from a broad set of Unicode by category rather than by codepoint range. The following are the definitions of the lexical productions, showing their relation to defined categories. SPACE_SEP ::= ? corresponds to the Unicode category 'Zs' ? ;
LC_ALPHA ::= ? corresponds to the Unicode category 'Ll' ? ;
UC_ALPHA ::= ? corresponds to the Unicode category 'Lu' ? ;
TC_ALPHA ::= ? corresponds to the Unicode category 'Lt' ? ;
ALPHA ::= LC_ALPHA | UC_ALPHA | TC_ALPHA ; The following productions are the key identifier -like values, built almost entirely from the character productions above with the addition of the single "_" underscore. predicate ::= LC_ALPHA ( ALPHA | DIGIT | "_" )* ;
named-variable ::= UC_ALPHA ( ALPHA | DIGIT | "_" )* ;
identifier-string ::= predicate ( ":" ALPHA ( ALPHA | DIGIT | "_" )* )? ;

